import React from "react";

function Card(props){
  return(
    <div className="card">
      <div className="top">
        <h2>{props.name}</h2>
        <img src={props.img}
              alt="avatar-image" />
              <div className="bottom">
                <p>{props.tele}</p>
                <p>{props.email}</p>
              </div>
      </div>
    </div>

  )
}

function App() {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      <Card 
        name="Beyonce"
        img="https://blackhistorywall.files.wordpress.com/2010/02/picture-device-independent-bitmap-119.jpg"
        tele="+123 456 789"

      />
    </div>
  );
}

export default App;
